#include<iostream>
#include<vector>
#include<algorithm>
using namespace std;
bool check(string& s,int l){
    if(s[l]=='a' || s[l]=='e' || s[l]=='i' || s[l]=='o' || s[l]=='u'){
        return true;
    }
    return false;
}
int Count(string& s,int startIdx,int endIdx){
    int count = 0;
    for(int i=startIdx;i<endIdx;i++){
        if(check(s,i)==true) {
            count++;
        }
    }
    return count;
}
int main(){
    string s = "";
    int k = 7;
    int n = s.length();
    int i = 0;
    int j = k;
    int p = i;
    int maxcount = 0;
    while(j<=n){
        maxcount = max(Count(s,i,j),maxcount);
        i++;
        j++;
    }
    cout<<endl;
    cout<<maxcount<<endl;
}